css:
.git-menu .autocomplete .autocomplete-menu {
  background: #252830;
  border-radius: 2px;
  border: 1px solid #181a1f;
}
.git-menu .autocomplete .autocomplete-menu .autocomplete-item {
  padding: 2px 5px;
  color: #d7dae0;
  line-height: 2em;
  border-radius: 2px;
}
.git-menu .autocomplete .autocomplete-menu .autocomplete-item.autocomplete-highlight {
  box-shadow: 0 0 1px 2px #6494ed inset;
}
.git-menu .autocomplete .autocomplete-menu .autocomplete-item.autocomplete-highlight .autocomplete-remove-button {
  display: inline-block;
}
.git-menu .autocomplete .autocomplete-menu .autocomplete-item .autocomplete-remove-button {
  float: right;
  width: 0;
  margin-right: 15px;
  cursor: pointer;
  display: none;
}
.git-menu .autocomplete .autocomplete-menu .autocomplete-item .autocomplete-remove-button:before {
  font-size: 16px;
  line-height: 17px;
}
.git-menu .autocomplete .autocomplete-menu .autocomplete-item .autocomplete-remove-button:hover {
  color: rgba(157, 165, 180, 0.6);
}
